    multicallAddress: '0xccc75e78Dce6A20bCCa3a30deB23Cb4D23df993a',
    getExplorerAddressLink: (address) => `https://testnet.snowtrace.io/address/${address}`,
    getExplorerTransactionLink: (transactionHash) => `https://testnet.snowtrace.io/tx/${transactionHash}`,
};
export default {
    Avalanche,
